import {useNavigate} from "react-router-dom";


export function BasketItem({item}){
    const navigate = useNavigate()

    return <div className={'border-b-2 ml-2'}>
        <div className={'cursor-pointer text-black/80 font-semibold'}
             onClick={()=>navigate(`/${item.categoryAPI}/${item.nameAPI}`)}>{item.name}
        </div>
        <div>
            <img src={item.image} alt={'nkar'} className={'w-10 h-10'}/>
        </div>

    </div>
}
